export async function getPlaces() {
  const response = await fetch(
    `${process.env.REACT_APP_API_URL}api/map/naver/quest/place/`
  );
  if (!response.ok) {
    throw new Error("데이터를 불러오는데 실패했습니다.");
  }
  const body = await response.json();
  return body;
}
